    constructor(){
      super();
      this.state ={
        name : "Reda Eskouni"
      }
      this.change_style = this.change_style.bind(this)
    }
    change_name (event){
      this.setState((e)=>{
        styling : {return e.name + " Clicking in button "}
      })
    }
    
    render(){
      return (
          <header>
            {this.state.name}
            <Children_header  />
          </header>
      );
    }
}

export default Header;
